import React from 'react';
import { BrowserRouter as Router, Route, Routes, useLocation } from 'react-router-dom';
import Login from './components/Login';
import Register from './components/Register';
import Navbar from './components/Navbar';
import NavTutor from './components/NavTutor';
import Home from './components/Home';
import About from './components/About';
import Class from './components/Class';
import Profile from './components/Profile';
import Detail from './components/Detail';
import HomeTutor from './components/HomeTutor';
import AboutTutor from './components/AboutTutor';
import ClassTutor from './components/ClassTutor';
import DetailTutor from './components/DetailTutor';
import ProfileTutor from './components/ProfileTutor';
import CreateClass from './components/CreateClass';
import Dashboard from './components/Dashboard';
import PrivateRoute from './components/PrivateRoute';

const App = () => {
  return (
    <Router>
      <Main />
    </Router>
  );
};

const Main = () => {
  const location = useLocation();
  const userType = localStorage.getItem('user_type');

  // Tentukan apakah rute saat ini adalah login atau register
  const isAuthRoute = location.pathname === '/' || location.pathname === '/register';

  return (
    <div>
      {/* Tampilkan Navbar yang sesuai berdasarkan user type */}
      {!isAuthRoute && (userType === 'tutor' ? <NavTutor /> : <Navbar />)}
      <Routes>
        <Route path="/register" element={<Register />} />
        <Route path="/" element={<Login />} />
        <Route path="/home" element={<PrivateRoute><Home /></PrivateRoute>} />
        <Route path="/about" element={<PrivateRoute><About /></PrivateRoute>} />
        <Route path="/class" element={<PrivateRoute><Class /></PrivateRoute>} />
        <Route path="/profile" element={<PrivateRoute><Profile /></PrivateRoute>} />
        <Route path="/class/:classId" element={<PrivateRoute><Detail /></PrivateRoute>} />
        <Route path="/homeTutor" element={<PrivateRoute><HomeTutor /></PrivateRoute>} />
        <Route path="/aboutTutor" element={<PrivateRoute><AboutTutor /></PrivateRoute>} />
        <Route path="/classTutor" element={<PrivateRoute><ClassTutor /></PrivateRoute>} />
        <Route path="/classTutor/:classId" element={<PrivateRoute><DetailTutor /></PrivateRoute>} />
        <Route path="/profileTutor" element={<PrivateRoute><ProfileTutor /></PrivateRoute>} />
        <Route path="/createClass" element={<PrivateRoute><CreateClass /></PrivateRoute>} />
        <Route path="/dashboard" element={<PrivateRoute><Dashboard /></PrivateRoute>} />
      </Routes>
    </div>
  );
};

export default App;
